import React, { Component} from 'react'
import ReactDOM from 'react-dom'
import Start from './Start'

export class App extends Component {
    
    render() {
        return (
            <div>
                <div className="navBar">
                    Current User: {}
                </div>
                <div>
                  <Start />
                </div>
            </div>
        )
    }
}

ReactDOM.render(<App></App>, document.getElementById("root"))
